import {FETCH_PICTURES,CHANGE_TERM } from '../actions/types';

const INTIAL_STATE = {
  term:"",
  images:[]
};

export default (state = INTIAL_STATE, action) => {
  switch (action.type) {
    case FETCH_PICTURES:
      return { ...state, images: action.payload };
    case CHANGE_TERM:
      return { ...state, term:action.payload };
    default:
      return state;
  }
};
